import { Heading } from "@chakra-ui/react";
import React, { Component } from "react";
import Slider from "react-slick";

export default class LinksHint extends Component {
  render() {
    var settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 4,
      slidesToScroll: 4,
      initialSlide: 0, 
      autoplay: true,
      speed: 4000,
      autoplaySpeed: 1000,
      cssEase: "linear",
      responsive: [
        {
          breakpoint: 1024,
          settings: {
            slidesToShow: 3,
            slidesToScroll: 3,
            infinite: true,
            dots: true
          }
        },
        {
          breakpoint: 600,
          settings: {
            slidesToShow: 2,
            slidesToScroll: 2,
            initialSlide: 2
          }
        },
        {
          breakpoint: 480,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1
          }
        }
      ]
    };

    let Data=[{img:"https://brandeps.com/logo-download/J/JavaScript-logo-vector-01.svg"},
    {img:"https://brandeps.com/logo-download/H/HTML-5-logo-vector-01.svg"},
    {img:"https://brandeps.com/logo-download/C/CSS-3-logo-vector-01.svg"},
    {img:"https://brandeps.com/logo-download/N/Node-JS-logo-vector-01.svg"},
    {img:"https://brandeps.com/logo-download/R/React-logo-vector-01.svg"}
  ]
    return (
      <div>
        <Heading>Skills</Heading>
        <Slider {...settings}>
          {Data.map((el,i)=>{
            return <div key={i+1} >
              <div  style={{boxShadow:"0px 2px 10px 1px red",margin:'10px'}} >
              <img style={{padding:""}} width="150px" height="200px" src={el.img} alt="" />
              </div>
              </div>
          })}
        </Slider>
      </div>
    );
  }
}
